def scramble(param):
  argument = param
  index = 2
  while (index < len(argument)):
    argument[index-2] += argument.pop(index-1)
    argument[index-1].append(argument[:index-2])
    index += 1
    
  return param

def unscramble(param):
    argument = param
    index = len(argument)-1
    while (index > 1):
        argument[index-1].pop()
        original_index_1 = [argument[index-2].pop()]
        argument.insert(index-1,original_index_1)
        index -= 1

    return param

def reassemble_flag(list):
    flag = ''
    for sublist in list:
        flag += chr(int(sublist.pop(),16))
    return flag

def get_flag():
  flag = open('flag.txt', 'r').read()
  flag = flag.strip()
  hex_flag = []
  for c in flag:
    hex_flag.append([str(hex(ord(c)))])

  return hex_flag

